            <div className="custom-file">
                <form>

                    <label class="FormField__Input">
                        <input type="file" id="customFile" />
                    </label>

                </form>
                <input type="submit" value='Upload' className="FormField__Button mr-20" />

            </div>

        );
    }
}

export default homeForm;
